import React from 'react';

const Projects = () => {
  return (
    <section className="projects">
      <h2>Social Media Links</h2>
      <div className="project-list">
        <div className="project-item">
          <h3><a href="https://www.tiktok.com" target="_blank" rel="noopener noreferrer">TikTok</a></h3>
        </div>
        <div className="project-item">
          <h3><a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer">LinkedIn</a></h3>
        </div>
        <div className="project-item">
          <h3><a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a></h3>
        </div>
        <div className="project-item">
          <h3><a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a></h3>
        </div>
      </div>
    </section>
  );
};

export default Projects;
